import './App.css';
import React from 'react'
// eslint-disable-next-line
import {Routes, Route, BrowserRouter} from 'react-router-dom';
import Main from './components/Main';
import RegSong from './page/RegSong';
import ModeSel from './page/ModeSel';
import GameBoard from './page/GameBoard';


function App() {
  return (
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Main/>}/>
          <Route path="/board/main" element={<Main/>}/>
          <Route path="/board/regSong" element={<RegSong/>}/>
          <Route path="/board/modeSel" element={<ModeSel/>}/>
          <Route path="/board/multiGameBoard" element={<GameBoard/>}/>
        </Routes>
      </BrowserRouter>
  );
}

export default App;
